import React, { Component } from 'react';
import axios from 'axios';

class editExerciseList extends Component {
    constructor(props) {
        super(props)

        this.state = {
          username: "",
          description: "",
          duration: 0,
          date: new Date(),
          users: [],
        };
    }

    componentDidMount() {
        axios.get("http://localhost:5000/exercises/" + this.props.match.params.id)
        .then(res=>{res.data})
    }

    render() {
        return 
    }
}

export default editExerciseList;
